Example of JavaScript I18n violations in a library or book order platform:

1. Hardcoded strings:

```javascript
function displayBook(book) {
  console.log(`Title: ${book.title}, Author: ${book.author}, Price: ${book.price}`);
}
```

In this example, the strings are hardcoded, making it difficult to translate the application for different languages.

2. Inconsistent file structure:

```javascript
// src/components/BookList.js
import Book from './Book';

function BookList({ books }) {
  return (
    <ul>
      {books.map((book) => (
        <Book key={book.id} book={book} />
      ))}
    </ul>
  );
}

// src/components/Book.js
function Book({ book }) {
  return (
    <li>
      <h3>{book.title}</h3>
      <p>{book.author}</p>
      <p>${book.price}</p>
    </li>
  );
}
```

In this example, the strings are hardcoded in the `Book` component, and the file structure is inconsistent, making it difficult to manage translations.

3. Lack of i18n library:

